import React from 'react';
import Iframe from 'react-iframe';
import Widget3 from './Widget3';

class Widget4 extends React.Component{

    render(){

        return(
            <Iframe
            styles={{width:100, position:'fixed'}}
            scrolling="no" 
            frameborder="0" 
            allowTransparency="true" 
            src="https://www.deezer.com/plugins/player?format=classic&autoplay=false&playlist=true&width=700&height=350&color=EF5466&layout=&size=medium&type=playlist&id=3621673922&app_id=1" 
            width="700" 
            height="240">

            </Iframe>
        )
    }
}
export default Widget4;
